import React from 'react';
import { CREATE_ROOM } from "../actions";

const initialState = {
    id: 0,
    name: 'ルーム番号',
    room: []
}

const testReducer = (state = initialState, action) => {
    switch (action.type) {
        case CREATE_ROOM:
            state.room.push();
            return;
        default:
            return state;
    }
}

export default testReducer;
